function Header(props) {
    const {currentNav, setCurrentNav} = props;
    return (
        <header>
            <div className='header-info'>
                <h1>Bryan Segarra</h1>
                <Navigation currentNav={currentNav} setCurrentNav={setCurrentNav} />
            </div>
        </header>
    );
}

export default Header;
